(5, 1, 6, '2023-09-08 08:15:00', '全員配信', 'テストです\r\n\r\n国土交通省では、令和4年12月に公表された提言において示された「地域インフラ群再生戦略マネジメント（以降、群マネ）」の取組を全国的に展開するため、以下の通りモデルケースとなる地方公共団体を募集します。「群マネ」を取り組みたいとお考えの地方公共団体の皆様におかれては、是非ご応募ください！\r\n\r\n募集要領、応募様式等詳細については下記報道発表資料をご確認ください。\r\n【報道発表URL】\r\nhttps://www.mlit.go.jp/report/press/sogo03_hh_000310.html　\r\n\r\n１．応募主体\r\n「群マネ」の計画策定・実施に関する検討を行う意向のある地方公共団体\r\n（詳細は募集要領を参照）\r\n２．募集期間\r\n令和５年９月６日（水）～１０月５日（木）１７：００（必着）\r\n３．支援内容\r\n「群マネ」の計画策定や業務の実施に関する必要な調査・検討・資料作成等の支援を行います。また、支援にあたっては、群マネ計画検討会・実施検討会の有識者から助言を頂くこととしております。（詳細は募集要領参照）\r\n４．支援期間\r\n１〜２年程度を想定しておりますが、必要に応じて延長する可能性があります。\r\n５．応募方法\r\n　募集要領をご確認の上、下記のメールアドレスまで応募様式をご送付ください。\r\n　電子メール：hqt-infra_mainte@ki.mlit.go.jp\r\n\r\n【お問い合わせ先】\r\n国土交通省　総合政策局公共事業企画調整課　原田、中村\r\n代表：03-5253-8111（内線：24543、24544）　直通：03-5253-8912\r\n電子メール：hqt-infra_mainte@ki.mlit.go.jp', 3, 6, NULL, 0, '2023-09-07 23:10:10', '2023-11-06 03:24:04', NULL, 1),
