(124, 1, 1, '2024-03-29 16:11:00', '改行チェックコピー品', '＋＋＋＋＋＋＋＋＋＋＋＋＋＋＋＋＋＋＋＋＋＋＋＋＋＋＋＋＋＋＋\r\n＋＋＋　　　　　インフラメンテナンス国民会議　　　　　　　　＋\r\n＋＋　　　　　　　　　　　　情報発信　　　　　　　　　　　＋＋\r\n＋　　　　　　　　       　　　Ｒ6.3.13    　　　  　　  　　　　＋＋＋\r\n＋＋＋＋＋＋＋＋＋＋＋＋＋＋＋＋＋＋＋＋＋＋＋＋＋＋＋＋＋＋＋\r\n＊本メールは、インフラメンテナンス国民会議のフォーラム活動などについて、\r\n　会員の皆様にお知らせするものです。\r\n \r\n【今回の配信内容】\r\n◇【国土交通省】令和６年度　民間提案型官民連携モデリング事業　ニーズ提案のHP掲載について\r\n==================================================\r\n◇【国土交通省】令和６年度　民間提案型官民連携モデリング事業　ニーズ提案のHP掲載について\r\n┏━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━┓\r\n┃　　　　　　　　　　　　シーズ・ニーズ募集中！　　　　　　　　　　　┃\r\n┃　　　　 　　　　　　～　最終締切3月19日（火）　～　　　　　　　　　┃\r\n┗━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━┛\r\n 　国土交通省　総合政策局　社会資本整備政策課では、官民連携事業の導入に関する取組を支援するため、民間提案に基づく新たな官民連携手法を、民間事業者・国土交通省と一体となって構築するため、「民間提案型官民連携モデリング事業」について、民間事業者、地方公共団体を対象に、特に以下５テーマのPPP/PFIに関するシーズ（民間事業者）・ニーズ（地方公共団体）を募集しています。\r\n【インフラ維持管理・修繕等】【災害対策・復旧を見据えたインフラ整備・維持管理】をマッチングテーマとしておりますので、官民連携によるインフラ維持管理等のニーズをお持ちの地方公共団体の皆様、インフラ維持管理等に関して新たな事業スキームや従来スキームの改善手法をお持ちの民間事業者の皆様におかれましてはご確認、ご提出の検討をいただけますと幸いです。\r\n\r\nまた、この度、地方公共団体からの官民連携に関するニーズについて、3月4日（月）時点で提出があったものを下記URL※に掲載いたしました。\r\n※https://www.mlit.go.jp/sogoseisaku/kanminrenkei/sosei_kanminrenkei_rd1_000100.html\r\n最終締切までに提出のあったニーズについては、順次公開する予定ですので、\r\n【インフラ維持管理・修繕等】【災害対策・復旧を見据えたインフラ整備・維持管理】に関するニーズをお持ちの地方公共団体の皆様は是非ご提出のご検討頂けると幸いです。\r\n民間事業者の皆様は、掲載ニーズ等を参考に、是非シーズのご提出を検討いただけますと幸いです。\r\n\r\nテーマ①：インフラの維持管理・修繕等\r\n　従来より公共が担っている利用料金を徴収しないインフラ（道路、橋梁、河川、公園等）に関し、民間のノウハウ、新技術の活用や業務のデジタル化等を通じ、包括的・広域的・長期的に業務を実施することにより、より効率的・効果的なインフラ運営を進めるもの。\r\n\r\nテーマ②：災害対策・復旧を見据えたインフラ整備・維持管理\r\n　地震等の自然災害が激甚化・頻発化するなか、民間の技術・ノウハウを活用して、自然災害の被害の軽減や早期復旧を見据えつつ、インフラ整備・維持管理を実施するもの。\r\n\r\nテーマ③：無電柱化\r\n　効果的・効率的な事業の推進を目的として、民間の技術・ノウハウを活用し、設計、工事、維持管理を包括的に委託するPFI手法により無電柱化を実施するもの。\r\n\r\nテーマ④：スモールコンセッション\r\n　地方公共団体が所有・取得する身近で小規模な遊休不動産（空き公共施設等）について、民間の創意工夫を最大限に生かした事業運営（コンセッションをはじめとしたPPP/PFI事業）により、官民連携で地域課題の解決やエリア価値向上につなげるもの。\r\n\r\nテーマ⑤：グリーンチャレンジ\r\n　カーボンニュートラルの達成や気候危機への対応など、グリーン社会の実現に向けた取組（ハード、ソフト両面を含む）に官民連携手法の導入を推進するもの。\r\n\r\n◆募集期間\r\n　地方公共団体からのニーズについては、３月19日（火）最終締切です。最終締切までに提出のあったニーズは、国土交通省HPに順次掲載します。\r\n　民間事業者からのシーズについては、３月19日（火）を締切とします。\r\n　（ニーズの一次締切後、ニーズを国土交通省HPに掲載しますので、民間事業者の皆様はシーズ提案の参考としてください。）\r\n　ご提出いただいたシーズ・ニーズについて、提案者が自らの提案をプレゼンするアピールタイム（4月中旬　オンライン開催予定）を実施し、官民マッチングを促進します。\r\n　その後、優良なシーズ提案については、5月以降、国からの調査委託により、民間提案に基づく新たな官民連携手法についての構築・導入検討をニーズ提案者などの地方公共団体におけるケーススタディとして実施予定です（15件程度を想定）。\r\n\r\n◆その他\r\n　今回の募集は、令和６年度予算の成立を前提に行うものであり、国会における予算審議の状況によっては、内容等を変更する場合があります。\r\n　募集要領、応募様式など詳細については、以下のURLをご確認ください。　\r\n　https://www.mlit.go.jp/report/press/sogo21_hh_000237.html\r\n\r\nご不明点等については、随時「国土交通省　総合政策局　社会資本整備政策課」あてお問合せください。\r\n\r\n【問合せ先】\r\n国土交通省総合政策局社会資本整備政策課\r\nTEL：03-5253-8111（代表）\r\n03-5253-8981（直通）\r\nE-mail：hqt-kanmin_renkei@gxb.mlit.go.jp\r\nFAX：03-5253-1548\r\n大西、渡邉、長坂（内線　26523、26532）\r\n\r\n==================================================\r\n┏━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━┓\r\n┃　　人事異動等により会員情報を変更する方は　　　　　　　　　　┃\r\n┃　　ホームページのマイページにて変更作業をお願いします　　　　┃\r\n┗━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━┛\r\nマイページはホームページ（https://jcim.jp/）からログインしてください\r\n==================================================\r\n＊本メールを配信しているメールアドレスは配信用です\r\n　【配信用アドレスに返信された場合はご対応ができない場合がございます】\r\n＊お問合せはこちら　→　https://jcim.jp/contact\r\n==================================================\r\n　インフラメンテナンス国民会議事務局：\r\n　　　　　　　　　　　　国土交通省 総合政策局 公共事業企画調整課', 3, 1, NULL, 0, '2024-03-29 07:12:22', '2024-03-29 07:13:02', '2024-03-29 16:11:00', 1),
