INSERT INTO `needs` (`id`, `user_id`, `forum_id`, `post_at`, `image_path`, `target_needs`, `condition`, `forum`, `collection_time`, `type_of_work`, `civil_engineering_field`, `needs_category`, `doing_status`, `doing_status_other`, `is_challenge_matching`, `is_success_matching`, `success_matching_info`, `after_matching_status`, `no_achieved_reason`, `no_achieved_reason_other`, `no_achieved_next`, `no_achieved_next_other`, `no_challenge_reason`, `no_challenge_reason_other`, `no_success_matching_reason`, `memo`, `comment`, `status`, `job`, `technical_require`, `organization`, `created_by`, `updated_by`, `created_at`, `updated_at`, `current_situation_or_roblems`, `content_needs`, `is_recruitment`, `sent_remind_mail_at`, `is_public`) VALUES
(810001, 1, 7, '2023-05-14 09:00:00', '', '従前の管理は事後保全であったため、損傷箇所が多く、対策費用も多額を要する実態にある。１巡目点検後の修繕が完了したあとが、本来の予防保全となると思われる。', '従前の管理は事後保全であったため、損傷箇所が多く、対策費用も多額を要する実態にある。１巡目点検後の修繕が完了したあとが、本来の予防保全となると思われる。', '北海道フォーラム', '2018年', 5, 1, '7', 1, '', 2, 0, '', 0, 0, '', 0, '', 4, 'フォーラムでの支援の可能性を含め検討段階', '', '', '', 3, '', '', '', 0, 0, '0000-00-00 00:00:00', '2024-01-10 07:52:40', '', '', 0, '2024-01-10 09:00:33', 1),
(810003, 1, 7, '2023-05-14 09:00:00', '', '②工事事業計画を立てる上で、橋梁点検業務の内、橋梁診断表に補修工法の単価または概算工事費を記載する様式にしてもらえると概算費見通しが立てやすい。', '②工事事業計画を立てる上で、橋梁点検業務の内、橋梁診断表に補修工法の単価または概算工事費を記載する様式にしてもらえると概算費見通しが立てやすい。', '北海道フォーラム', '2018年', 5, 1, '7', 5, '', 0, 0, '', 0, 0, '', 0, '', 0, '', '', '', '', 2, '', '', '', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', 0, NULL, 1),
(810005, 1, 7, '2023-05-14 09:00:00', '', '・点検結果に基づく長寿命化改修工事が今後必要な橋が多いが、人員が足りず事業期間の延長が必要である。', '・点検結果に基づく長寿命化改修工事が今後必要な橋が多いが、人員が足りず事業期間の延長が必要である。', '北海道フォーラム', '2018年', 3, 1, '4', 1, '', 2, 0, '', 0, 0, '', 0, '', 4, 'フォーラムでの支援の可能性を含め検討段階', '', '', '', 2, '', '', '', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', 0, NULL, 1),
(810006, 1, 7, '2023-05-14 09:00:00', '', '現在、社会資本整備総合交付金を活用し、補修・改修を行っているが、5年に1度の点検費用や老朽化した橋梁補修費用の確保が厳しくなってきている。', '現在、社会資本整備総合交付金を活用し、補修・改修を行っているが、5年に1度の点検費用や老朽化した橋梁補修費用の確保が厳しくなってきている。', '北海道フォーラム', '2018年', 3, 1, '5', 5, 'マッチングで解消できるニーズではないため', 0, 0, '', 0, 0, '', 0, '', 0, '', '', '', '', 3, '', '', '', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', 0, NULL, 1),
(810007, 1, 7, '2023-05-14 09:00:00', '', '老朽化する構造物の増加により、予算や人材不足に陥るのではないかという不安はある。', '老朽化する構造物の増加により、予算や人材不足に陥るのではないかという不安はある。', '北海道フォーラム', '2018年', 5, 1, '4', 5, 'マッチングで解消できるニーズではないため', 0, 0, '', 0, 0, '', 0, '', 0, '', '', '', '', 2, '', '', '', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', 0, NULL, 1),
(810008, 1, 7, '2023-05-14 09:00:00', '', '判定ランクⅢの橋梁が多数あり、技術者・予算が少ないことから5年以内に補修することは難しい状況にある。', '判定ランクⅢの橋梁が多数あり、技術者・予算が少ないことから5年以内に補修することは難しい状況にある。', '北海道フォーラム', '2018年', 3, 1, '5', 5, 'マッチングで解消できるニーズではないため', 0, 0, '', 0, 0, '', 0, '', 0, '', '', '', '', 3, '', '', '', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', 0, NULL, 1),
(810009, 1, 7, '2023-05-14 09:00:00', '', '古い橋梁で設計時の図面や構造計算書などが無く、補修するにも照査が出来ない橋梁があり、今後の補修工事や維持管理にこまる。\nまた、近年は農機具や運材車輌が大型化しており、昔の橋梁が壊れないか心配である。', '古い橋梁で設計時の図面や構造計算書などが無く、補修するにも照査が出来ない橋梁があり、今後の補修工事や維持管理にこまる。\nまた、近年は農機具や運材車輌が大型化しており、昔の橋梁が壊れないか心配である。', '北海道フォーラム', '2018年', 5, 1, '7', 1, '', 2, 0, '', 0, 0, '', 0, '', 4, 'フォーラムでの支援の可能性を含め検討段階', '', '', '', 3, '', '', '', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', 0, NULL, 1),
(810010, 1, 7, '2023-05-14 09:00:00', '', '200ｍを越える長大橋が３橋あり、橋梁の点検、補修に関して予算、技術的に課題が残る。', '200ｍを越える長大橋が３橋あり、橋梁の点検、補修に関して予算、技術的に課題が残る。', '北海道フォーラム', '2018年', 3, 1, '1', 1, '', 2, 0, '', 0, 0, '', 0, '', 4, 'フォーラムでの支援の可能性を含め検討段階', '', '', '', 3, '', '', '', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', 0, NULL, 1),
(810011, 1, 7, '2023-05-14 09:00:00', '', '例年交付金が要求額に対して7割程度しか内示されず単独費の持出しが大きく計画通りに実施するのが困難である。', '例年交付金が要求額に対して7割程度しか内示されず単独費の持出しが大きく計画通りに実施するのが困難である。', '北海道フォーラム', '2018年', 5, 1, '5', 5, 'マッチングで解消できるニーズではないため', 0, 0, '', 0, 0, '', 0, '', 0, '', '', '', '', 3, '', '', '', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', 0, NULL, 1),
(810012, 1, 7, '2023-05-14 09:00:00', '', '人件費等の高騰により、橋梁補修費のほか、５年に１回実施する近接目視による橋梁点検の費用負担が大きくなっており、負担軽減を図るために、例えば点検結果が判定区分Ⅰの場合は次回点検を１０年後とするとか、遠望目視点検により実施できるなどの取組みができないか。', '人件費等の高騰により、橋梁補修費のほか、５年に１回実施する近接目視による橋梁点検の費用負担が大きくなっており、負担軽減を図るために、例えば点検結果が判定区分Ⅰの場合は次回点検を１０年後とするとか、遠望目視点検により実施できるなどの取組みができないか。', '北海道フォーラム', '2018年', 1, 1, '7', 5, 'マッチングで解消できるニーズではないため', 0, 0, '', 0, 0, '', 0, '', 0, '', '', '', '', 3, '', '', '', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', 0, NULL, 1),
(810013, 1, 7, '2023-05-14 09:00:00', '', '付属施設において、数が多く台帳の整理に苦慮している。\nシステム等で管理したいが、導入予算がなくエクセル管理となっている。\n一括したデータベースシステム等あると施設の更新や管理もしやすい。', '付属施設において、数が多く台帳の整理に苦慮している。\nシステム等で管理したいが、導入予算がなくエクセル管理となっている。\n一括したデータベースシステム等あると施設の更新や管理もしやすい。', '北海道フォーラム', '2018年', 4, 1, '1', 1, '', 2, 0, '', 0, 0, '', 0, '', 4, 'フォーラムでの支援の可能性を含め検討段階', '', '', '', 3, '', '', '', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', 0, NULL, 1),
(810014, 1, 7, '2023-05-14 09:00:00', '', '①道路構造物の点検等は、国からの経済支援として、社会資本整備総合交付金を活用している。現在の交付金適用条件では、橋梁へアプローチする擁壁が「橋梁」附帯物とみなさず、「法面・土工構造物」とされており、管理計画に沿った補修工事が実施困難となることや、申請事務作業が煩雑となっている。', '①道路構造物の点検等は、国からの経済支援として、社会資本整備総合交付金を活用している。現在の交付金適用条件では、橋梁へアプローチする擁壁が「橋梁」附帯物とみなさず、「法面・土工構造物」とされており、管理計画に沿った補修工事が実施困難となることや、申請事務作業が煩雑となっている。', '北海道フォーラム', '2018年', 3, 1, '5', 5, 'マッチングで解消できるニーズではないため', 0, 0, '', 0, 0, '', 0, '', 0, '', '', '', '', 3, '', '', '', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', 0, NULL, 1),
(810015, 1, 7, '2023-05-14 09:00:00', '', '人員・予算が不足しているため、細かい部分の維持管理までは適切に実施できていない', '人員・予算が不足しているため、細かい部分の維持管理までは適切に実施できていない', '北海道フォーラム', '2018年', 5, 1, '4', 5, 'マッチングで解消できるニーズではないため', 0, 0, '', 0, 0, '', 0, '', 0, '', '', '', '', 3, '', '', '', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', 0, NULL, 1),
(810016, 1, 7, '2023-05-14 09:00:00', '', '・道路構造物については、31年度より点検・調査を考えています。また、技術職員不足のため、効率の良い管理方法があれば参考にしたい。', '・道路構造物については、31年度より点検・調査を考えています。また、技術職員不足のため、効率の良い管理方法があれば参考にしたい。', '北海道フォーラム', '2018年', 1, 1, '4', 1, '', 2, 0, '', 0, 0, '', 0, '', 4, 'フォーラムでの支援の可能性を含め検討段階', '', '', '', 3, '', '', '', 0, 0, '0000-00-00 00:00:00', '2024-04-01 03:04:57', '', '', 0, NULL, 1),
(810017, 1, 7, '2023-05-14 09:00:00', '', '橋梁以外の道路構造物の管理が台帳等によりされておらず、今後の課題となっている。', '橋梁以外の道路構造物の管理が台帳等によりされておらず、今後の課題となっている。', '北海道フォーラム', '2018年', 4, 1, '1', 1, '', 2, 0, '', 0, 0, '', 0, '', 4, 'フォーラムでの支援の可能性を含め検討段階', '', '', '', 3, '', '', '', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', 0, NULL, 1),
(810018, 1, 7, '2023-05-14 09:00:00', '', '絶対数が多いため、状況を把握しきれていない部分がある。', '絶対数が多いため、状況を把握しきれていない部分がある。', '北海道フォーラム', '2018年', 1, 1, '7', 1, '', 2, 0, '', 0, 0, '', 0, '', 4, 'フォーラムでの支援の可能性を含め検討段階', '', '', '', 3, '', '', '', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', 0, NULL, 1),
(810019, 1, 7, '2023-05-14 09:00:00', '', 'トンネルは通行止め、未供用のため点検予定無し。擁壁・法面・付属物の点検はほぼ完了し、今後の維持補修を検討中。担当者が１名のため、手が回らない状況になっている。', 'トンネルは通行止め、未供用のため点検予定無し。擁壁・法面・付属物の点検はほぼ完了し、今後の維持補修を検討中。担当者が１名のため、手が回らない状況になっている。', '北海道フォーラム', '2018年', 5, 1, '4', 5, 'マッチングで解消できるニーズではないため', 0, 0, '', 0, 0, '', 0, '', 0, '', '', '', '', 3, '', '', '', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', 0, NULL, 1),
(810020, 1, 7, '2023-05-14 09:00:00', '', '排水施設や照明施設は点検するにも膨大な経費がかかり、法律で点検を義務化されても、人手不足・財源不足でとりかかれない', '排水施設や照明施設は点検するにも膨大な経費がかかり、法律で点検を義務化されても、人手不足・財源不足でとりかかれない', '北海道フォーラム', '2018年', 1, 1, '5', 5, 'マッチングで解消できるニーズではないため', 0, 0, '', 0, 0, '', 0, '', 0, '', '', '', '', 3, '', '', '', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', 0, NULL, 1),
(810021, 1, 7, '2023-05-14 09:00:00', '', '橋梁以外の道路構造物に関して、ストック点検は実施してきているが、橋梁、舗装の補修に予算が集中してしまうため、付属構造物までの予算はまわらない現状にある。今後、部分的に補修を実施していきたい。', '橋梁以外の道路構造物に関して、ストック点検は実施してきているが、橋梁、舗装の補修に予算が集中してしまうため、付属構造物までの予算はまわらない現状にある。今後、部分的に補修を実施していきたい。', '北海道フォーラム', '2018年', 3, 1, '5', 5, 'マッチングで解消できるニーズではないため', 0, 0, '', 0, 0, '', 0, '', 0, '', '', '', '', 3, '', '', '', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', 0, NULL, 1),
(810022, 1, 7, '2023-05-14 09:00:00', '', '橋梁以外の道路構造物に関しては、管理台帳が一部のみしか整備されていないため、個別施設計画を含め整備を進める必要がある。', '橋梁以外の道路構造物に関しては、管理台帳が一部のみしか整備されていないため、個別施設計画を含め整備を進める必要がある。', '北海道フォーラム', '2018年', 4, 1, '7', 1, '', 2, 0, '', 0, 0, '', 0, '', 4, 'フォーラムでの支援の可能性を含め検討段階', '', '', '', 3, '', '', '', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', 0, NULL, 1),
(810023, 1, 7, '2023-05-14 09:00:00', '', '法面や付属施設については、既存の資料が乏しく、状態を把握する以前に、図面等の復元に大変苦労している。', '法面や付属施設については、既存の資料が乏しく、状態を把握する以前に、図面等の復元に大変苦労している。', '北海道フォーラム', '2018年', 4, 1, '7', 1, '', 2, 0, '', 0, 0, '', 0, '', 4, 'フォーラムでの支援の可能性を含め検討段階', '', '', '', 3, '', '', '', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', 0, NULL, 1),
(810024, 1, 7, '2023-05-14 09:00:00', '', '管路の劣化・老朽化は、腐食または経年により進行し、管体割れや継手離脱の漏水事故率が高くなります。漏水は収益低下にのみならず、断水や路面陥没等重大事故にもつながることから、安定給水と高効率かつ低コストな水道再構築のためにも、適切な管路更新を行っていかなければなりません。', '管路の劣化・老朽化は、腐食または経年により進行し、管体割れや継手離脱の漏水事故率が高くなります。漏水は収益低下にのみならず、断水や路面陥没等重大事故にもつながることから、安定給水と高効率かつ低コストな水道再構築のためにも、適切な管路更新を行っていかなければなりません。', '北海道フォーラム', '2018年', 5, 13, '7', 5, 'マッチングで解消できるニーズではないため', 0, 0, '', 0, 0, '', 0, '', 0, '', '', '', '', 3, '', '', '', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', 0, NULL, 1),
(810025, 1, 7, '2023-05-14 09:00:00', '', '近年、配水管・給水管の老朽化に伴う漏水件数が増加しており、道路改良時に上水道管の布設替えを行うことで、公道内の配水管並びに給水管の老朽管路の更新を行っている。', '近年、配水管・給水管の老朽化に伴う漏水件数が増加しており、道路改良時に上水道管の布設替えを行うことで、公道内の配水管並びに給水管の老朽管路の更新を行っている。', '北海道フォーラム', '2018年', 5, 13, '7', 5, 'マッチングで解消できるニーズではないため', 0, 0, '', 0, 0, '', 0, '', 0, '', '', '', '', 3, '', '', '', 0, 0, '0000-00-00 00:00:00', '2024-04-01 03:59:44', '', '', 0, NULL, 0),
