(1, '<p><!-- ※内容については以下URL からご確認ください。<br>\r\n        https://dev.cheat-co.net/058_12hovASAE/0203/index.html -->令和4年度インフラメンテナンス国民会議総会について、実施要領第12 条第1項に基づき、 メールにより開催いたします。<br>つきましては、以下の3議案について、本メールにより会員の皆様にお諮りいたします。<br>当該議案について、特段の意見がない場合、令和4年12 月7日(水)に社会<br>インフラテック2022内で開催の総会の場において本議案を決議とさせていただきます。</p><p>【議案】<br>第1号議案 会長及び副会長選任の件 (実施要領第18 条)<br>第2号議案 実行委員長及び実行委員選任の件 (実施要領第23 条第2 項)<br>第3号議案 実施要領の変更の件(実施要領第31 条)</p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://www.test-environment.online/media/1_1711416787.png\"></figure>', 1, '2023-08-07 04:01:03', '2024-03-26 02:40:00');
